import React, { Component } from "react";
class Settings extends Component {
  state = {};
  render() {
    let rowStyle = {
      background: "white"
    };
    return (
      <div className="container ">
        <div className="row mt-5" style={rowStyle}>
          <div className="col-md-3" />

          <div className="col-md-9">
            <label>
              Total budget
              <input
                type="text"
                name="totalBudget"
                style={{
                  display: "inline-box",
                  marginRight: "16px",
                  marginLeft: "16px"
                }}
              />
            </label>
            <button type="button" style={{ display: "inline-box" }}>
              Update
            </button>
          </div>
          <div className="col-md-2" />
        </div>

        <br />
        <div className="row mt-5" style={rowStyle}>
          <div className="col-md-3" />

          <div className="col-md-9">
            <label>
              Categories
              <input
                type="text"
                name="totalBudget"
                style={{
                  display: "inline-box",
                  marginRight: "16px",
                  marginLeft: "16px"
                }}
              />
            </label>
            <button type="button" style={{ display: "inline-box" }}>
              Add
            </button>
          </div>
          <div className="col-md-2" />
        </div>
      </div>
    );
  }
}

export default Settings;
